      out.write("\r\n");
      out.write("                if (!endTimeText) return; // endTimeText가 없으면 건너뜀\r\n");
      out.write("\r\n");
      out.write("                const parts = endTimeText.split(\" \");\r\n");
      out.write("                const months = {\r\n");
      out.write("                    Jan: 0, Feb: 1, Mar: 2, Apr: 3, May: 4, Jun: 5,\r\n");
