      out.write("                const month = months[parts[1]];\r\n");
      out.write("                const day = parseInt(parts[2], 10);\r\n");
      out.write("                const [hours, minutes, seconds] = parts[3].split(\":\").map(Number);\r\n");
      out.write("\r\n");
      out.write("                const endTime = new Date(year, month, day, hours, minutes, seconds);\r\n");
      out.write("\r\n");
      out.write("                if (now > endTime) {\r\n");
      out.write("                    // 상영 시간이 지난 경우\r\n");
