      out.write("                    $(this).find(\".d-day\").css(\"color\", \"\");\r\n");
      out.write("                    $(this).find(\".cancel-btn\").show();\r\n");
      out.write("                    $(this).find(\".review-btn\").hide();\r\n");
      out.write("                }\r\n");
      out.write("            });\r\n");
      out.write("        });\r\n");
